module.exports = /*#__PURE__*/JSON.parse('[{"id":1,"name":"Scottsdale","img":"/ok-scottsdale.jpg","des":"🌟 Introducing Canine Haven: Where Luxury Meets Security for Your Furry Friend! 🐾 Nestled in Scottsdale, AZ, our state-of-the-art dog kennels create the ultimate retreat for your beloved pup in your own home.","detail":"🔒 Unwavering Safety: Your Kennel is equipped with high-density steel, 24/7 your pup is given a superman\'s hug, giving you peace of mind knowing your dog is safe. 🐶 At pet safe kennels, we\'re more than just a kennel—we\'re a sanctuary where your dog\'s comfort and safety come first."},{"id":2,"name":"Tempe","img":"/Tempe.jpg","des":"At Pet Safe Kennels, we understand that your dog isn\'t just a pet; they\'re a cherished member of your family. That\'s why we\'ve gone above and beyond to create a haven of safety and security in the heart of Tempe, Arizona.","detail":"it\'s a fortress of safety. 🐾 With robust enclosures, vigilant surveillance, and a dedicated team, we ensure your dog is protected from predators at all times. Your peace of mind matters to us, because we know your dog\'s safety is non-negotiable. Trust Pet Safe Kennels for the ultimate protection for your beloved companion. #PetSafeTempe #SafetyFirst #FurFamily 🐶💖"},{"id":3,"name":"Goodyear","img":"/goodyear-kennel.jpg","des":"🌵 Welcome to Pet Safe Kennels in Goodyear, AZ, where your pet\'s safety is our top priority! 🐾 In the rugged beauty of the desert, we understand the unique challenges your furry friend may face—from snakes to wildcats to coyotes. ","detail":"Your peace of mind matters to us, and we are committed to providing a sanctuary where your beloved companion can relax and thrive without worry. Trust Pet Safe Kennels for protection against the wild elements of the Arizona desert. 🐶🌵 #PetSafeGoodyear #DesertGuardians #FurFamilySafety"},{"id":4,"name":"Peoria","img":"/Peoria-kennel-2.jpg","des":"🐾🐾 Welcome to Pet Fortress Kennels in Peoria, where durability meets peace of mind for you and your beloved pet!🏡","detail":" Our kennels are built to last as long as your car, providing a fortress of protection that you can trust. With our 100% guarantee, you can rest assured that your furry friend is safe from any harm. From sturdy construction to innovative design, our kennels are crafted to withstand the test of time and keep your pet secure in any situation. Choose Pet Fortress Kennels for unparalleled durability and protection for your furry family member. 🛡️🐶 #PetFortressPeoria #DurableProtection #PeaceOfMind"},{"id":5,"name":"Fountain Hills","img":"/fountain hills.jpg","des":"🐾 Introducing Pet Safe Kennels Expert Dog Kennel! 🐶✨We understand that your fur family\'s safety is your top priority, which is why we\'re thrilled to introduce our custom-made dog kennels, guaranteed to protect your beloved pets! 🏡💖🐕🔒","detail":"With Pet Safe Kennels, you can rest assured that your furry friends are in the best hands. Our expertly designed kennels provide the ultimate sanctuary for your pets, offering unmatched security and comfort. Whether you\'re at work, running errands, or away on vacation, our kennels will give you peace of mind knowing that your pets are safe and sound. 🐕🔒 Say goodbye to worries about your pet\'s well-being and hello to worry-free days ahead! Experience the difference with Pet Safe Kennels Expert Dog Kennel today. Contact us to learn more and give your pets the protection they deserve. 🌟🐾 #PetSafeKennels #DogKennel #PetProtection #FurFamilySafety"},{"id":6,"name":"Glendale","img":"/glendale.jpg","des":"🐾Expert Dog Kennels in Glendale Arizona! 🐶✨Your pet\'s safety matters to us as it does to you. We guarantee to protect your beloved pets! 🏡💖🐕🔒","detail":"🐾 Searching for the ultimate peace of mind for your furry friend? Look no further! Pet Safe Kennels\' custom-made dog kennels are the answer to all your worries. With their top-notch construction and design, these kennels provide the perfect blend of security and comfort for your beloved pup. From sturdy materials to spacious layouts, every detail is tailored to ensure your dog\'s safety and well-being. Whether you\'re at work or away on vacation, rest assured knowing that your canine companion is protected in their very own sanctuary. Say goodbye to concerns about escapes or accidents—trust Pet Safe Kennels for unmatched peace of mind. 🏡🐶 #PetSafeKennels #DogSafety #PeaceOfMind"},{"id":7,"name":"CaveCreek","img":"/cavecreek-kennel.jpg","des":"🐾 🐶✨ 🐾🌟 Looking for the ultimate protection for your furry friends? Look no further! Introducing Pet Safe Kennels - your go-to solution for a secure haven right in your backyard. 🌟🐾🏡💖🐕🔒","detail":"🐾 🏞️ Nestled in the serene landscapes of Cave Creek, AZ, our top-notch dog kennels offer unparalleled safety for your beloved pups. With our robust construction, you can rest assured that even the most determined mountain lion won\'t stand a chance against our fortified enclosures. 🏡🐶 #PetSafeKennels #DogSafety #PeaceOfMind ✅ What sets us apart? We\'re not just any kennel company - we\'re Pet Safe Kennels, and we stand by our name. We guarantee the safety of your pets, providing you with peace of mind like never before.🐾 Don\'t compromise when it comes to your pet\'s safety. Choose Pet Safe Kennels and give your four-legged companions the protection they deserve. Contact us today to learn more and schedule your installation! #PetSafeKennels #CaveCreekAZ #ProtectYourPets #SafetyFirst 🐾🏡"},{"id":8,"name":"Paradise Valley","img":"/ParadiseValley.jpg","des":"🐾 🐶✨ 🐾🌟🐾 Calling all pet lovers in Paradise Valley, AZ! Your search for the ultimate haven for your furry companions ends here with Pet Safe Kennels. 🐾🌟 🌟🐾🏡💖🐕🔒","detail":"🐾 🏞️ Situated amidst the breathtaking beauty of Paradise Valley, our state-of-the-art dog kennels offer not only unparalleled safety but also a touch of luxury for your beloved pets. Imagine your pups enjoying the serene surroundings and sunny skies of this prestigious city, all while being safely enclosed in our secure enclosures. 🏞️ #PetSafeKennels #DogSafety #PeaceOfMind ✅ #ProtectYourPets #SafetyFirst 🐾🏡 ✨ What makes us stand out? At Pet Safe Kennels, we understand the discerning tastes of Paradise Valley residents. That\'s why our kennels not only provide top-notch protection but also exude elegance and sophistication, perfectly complementing the upscale vibe of this renowned community."}]');

